import React from "react";
import { connect } from "react-redux";

import TableHeader from "../common/TableHeader";

const BoardsShow = () => {
  return (
    <React.Fragment>
      <TableHeader />
    </React.Fragment>
  );
};

const mapStateToProps = (state) => {
  console.log(state);
  return state;
};

export default connect(mapStateToProps)(BoardsShow);
